window.bookSummaryJSON = "<p>Set in the same world as the <i>New York Times</i> best-selling Jane Yellowrock novels, an all-new series starring Nell Ingram, who wields powers as old as the earth. </p> <p>When Nell Ingram met skinwalker Jane Yellowrock, she was almost alone in the world, exiled by both choice and fear from the cult she was raised in, defending herself with the magic she drew from her deep connection to the forest that surrounds her. </p> <p>Now, Jane has referred Nell to PsyLED, a Homeland Security agency policing paranormals, and agent Rick LaFleur has shown up at Nell's doorstep. His appearance forces her out of her isolated life into an investigation that leads to the vampire Blood Master of Nashville. </p> <p>Nell has a team - and a mission. But to find the Master's kidnapped vassal, Nell and the PsyLED team will be forced to go deep into the heart of the very cult Nell fears, infiltrating the cult and a humans-only terrorist group before time runs out.... </p>"; 
